import React, { Component } from 'react';
import Nav from './Components/Nav/Nav';
import routes from './routes';
import './App.css';


class App extends Component {


  render() { 
    if(this.props.location !== "/"){
      return this.props.path;
    } else {
      return null;
    };

    return ( 
        <div>
            <Nav path={this.props.location}/>
            {routes}
        </div>
     );
  }
}

export default App;
